import { Row } from 'native-base';
import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
    container: {
      flex: 1,
      justifyContent: 'center',
      alignItems: 'center',
      backgroundColor: '#ebebeb'
    },
    text: {
      color: '#101010',
      fontSize: 24,
      fontWeight: 'bold'
    },
    buttonContainer: {
      backgroundColor: '#222',
      borderRadius: 5,
      padding: 10,
      margin: 20
    },
    buttonText: {
      fontSize: 20,
      color: '#fff'
    },
    signUpBox: {
      width: 300
    },
    checkBoxContainer: {
      flexDirection: "row"
    },
    checkBox: {
      alignSelf: "center"
    },
    label: {
      margin: 8,
      color: '#2c2c2c',
    }
  });

export default styles;
